INSERT INTO `t_interviewquest` VALUES ('1', '3', '病狗神题:50人有50条狗，有病狗。每天傍晚大家都在同一个地方遛狗，不能交流，只能观察其他人的狗。如果推断出自家狗是病狗，就要枪毙，只能枪毙自家狗。第一天没有枪声，第二天有一阵枪声。请问有几只病狗？', '题目中已经提到有病狗，假设病狗数量为N。（以下解析中，A：表示病狗主人，B：表示非病狗主人）\r\n第一天\r\n若N=1，毫无疑问A看不到病狗，就可以确定自己的狗有病。这时候A就开枪了。B看到A开枪就明白：A没有看到其他的病狗。因为如果A看到了就不能确定自己的狗是病狗；因此B知道自己的狗不是病狗。答案浮出水面：N=1。\r\n若N≥2，A必须有看到的病狗，当天不会开枪，进入第二天。\r\n第二天\r\n通过第一天可以得出N≥2；若A第一天只看到一条病狗，无疑自己的狗有病。两个A开枪，答案N=2。若A看到的病狗≥2，这个时候不会有答案，继续进入第三天。且得出N≥3\r\n第三天\r\n已经得出N≥3，若A当初看到两条病狗，证明自己的狗有病。三个A开枪，答案N=3。若A看到病狗≥3，同样判断不出结果，进入第四天。且得出N≥4\r\n直到有一天\r\n（B看到的病狗永远都比A看到的多一条，因此B不会开枪）\r\n第P天\r\n通过以上结论得出N≥P，A看到P-1条病狗的时候，所有的A都明白了：自己的狗是病狗。答案N=（P-1)+1；即N=P\r\n终上所述：第几天听到枪声即表示有几条病狗。', 'qf000001', '2018-06-28');
INSERT INTO `t_interviewquest` VALUES ('2', '3', '3盏灯和3个开关  　　　有两间房子，一间房有3个灯，另外一间房有控制着3盏灯的开关。现在要你分别进入这两个房间一次，然后判断这3盏灯分别是由哪个开关控制的？', '3盏灯和3个开关\r\n\r\n　　　有两间房子，一间房有3个灯，另外一间房有控制着3盏灯的开关。现在要你分别进入这两个房间一次，然后判断这3盏灯分别是由哪个开关控制的？', 'qf000001', '2018-06-28');
